import React from 'react'
import Item from '../../Components/JSX/Item'
import pictures from '../../Assets/menu.js'
const Menu = () => {
  return (
    <div className='menu'>
      <h1>Menu</h1>
      <div className="meu-items">
      {pictures.map((elem,index)=>{
        
        return <Item key={index} image={elem.image} text={elem.text}></Item>
      })}
      </div>
    </div>
  )
}

export default Menu
